pragma solidity ^0.4.13;

import "./Controlled.sol";
import "./Controller.sol";
import "./Owned.sol";
import "./Token.sol";

contract ICO is Owned, Controller {  
  //ICO es el controlador, tiene el método proxypayment y permite que des del token "controlado" se pueda avisar a ICO para que haga operación.

    uint256 constant public limit = 100 ether; //limite de inversión por address
    uint256 constant public exchange = 10; //número de tokens que voy a dar por ether
    uint256 public totalCollected; //sumará las aportaciones de los tokenholders

    Token public token; //contract Token
    address public ICOAccount; //dirección de la ICO, irán todos los Ethers

    constructor() public { 
        owner = msg.sender;
        totalCollected = 0;
    }

    modifier initialized() { // modificador para comprobar que la ICO se ha inicializado
        require(address(token) != 0x0);
        _;
    }
    
    function initialize ( address _token, address _icoAccount) public  { 
        require(address(token) == 0x0); //comprobamos que no se inicializa más de una vez
        token = Token(_token); //creamos Token con dirección que nos dan
        require(token.totalSupply() == 0); //comprobamos datos a 0, que no sea token usado
        require(token.controller() == address(this)); //controller debe ser la address owner (ICO)
        ICOAccount = _icoAccount; //Cuenta destino de Ethers de la ICO
    }

    function proxyPayment(address _th) public payable returns (bool) { //método de compra
        return doBuy(_th, msg.value); // llamo al método doBuy por que 
    }

    function doBuy(address _sender, uint _amount) public returns (bool) { // función de compra
        uint256 tokensGenerated = _amount * exchange;  // calculamos cuantos tokens hay que generar (exchange és el número tokens por ether)
        require (totalCollected + _amount <= limit); // evaluamos que no superemos el límite, si nos pasamos bloqueamos
        assert(token.generateTokens(_sender, tokensGenerated)); //se generan los tokens
        ICOAccount.transfer(_amount); // se transfiere el amount
        totalCollected = totalCollected + _amount; //sumamos lo que se ha añadido
        return true;
    }



    function() public payable {  //función que es fallback, se hace por si un usuario envía dinero a la address de la ICO
                                // en vez del Token, al final se llamará a proxypayment para aprovechar el pago. Así no se pierde.
        proxyPayment(msg.sender);
    }


    /** METODOS INFORMATIVOS */
    function obtenerDireccionContrato() public view returns (address) {
        return address(this);
    }
    
    function obtenerDireccionOwner() public view returns (address) {
        return address(owner);
    }

    

}
